// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

struct AddressArray {
    address pollAddress;
}

contract PollIO {
    address payable public owner;
    // mapping(address => AddressArray[]) internal db;
    mapping(address => Poll[]) internal db;

    constructor() {
        owner = payable(msg.sender);
    }

    function createPoll (
        string memory pollName,
        uint pollDuration, 
        string[] memory _candidates, 
        string memory _pollType
    ) public {
        Poll newPoll = new Poll(msg.sender, pollName, pollDuration, _candidates, _pollType);
        // db[msg.sender].push(AddressArray(newPoll));
        Poll[] memory polls = db[msg.sender];
        polls[polls.length] = newPoll;
        // polls.push(newPoll);
        db[msg.sender] = polls;
    }

    function getPreviousPolls() public view returns(Poll[] memory) {
        return db[msg.sender];
    }
}


contract Poll {
    address payable public org;
    string public pollName;
    string[] public candidates;
    uint public startBlock;
    uint public endBlock;

    enum Type {Public, Private}
    Type public pollType;

    enum State {Started, Running, Cancelled, Ended}
    State public pollState;

    mapping(address => bool) internal isVoted;
    mapping(string => uint) internal result;

    constructor (
        address eoa, 
        string memory _pollName,
        uint pollDuration, 
        string[] memory _candidates, 
        string memory _pollType
    ) {
        org = payable(eoa);
        pollName = _pollName;
        candidates = _candidates;
        startBlock = block.number;
        endBlock = startBlock + pollDuration;
        pollState = State.Running;

        if (keccak256(abi.encodePacked((_pollType))) == keccak256(abi.encodePacked(("Public")))) {
            pollType = Type.Public;
        } else {
            pollType == Type.Private;
        }

        for (uint i = 0; i < candidates.length; i++) {
            result[candidates[i]] = 0;
        }
    }

    modifier onlyOrg {
        require(org == msg.sender);
        _;
    }

    modifier beforeEnd {
        require(block.number < endBlock);
        _;
    }

    modifier afterStart {
        require(block.number > startBlock);
        _;
    }

    modifier dependsOnPollType {
        if (pollType == Type.Private) {
            require(org == msg.sender, "This is a private poll.");
            _;
        } else {
            _;
        }
    }

    function renamePoll(string memory name) public onlyOrg {
        pollName = name;
    }

    function increasePollDuration(uint pollDuration) public onlyOrg {
        endBlock = endBlock + pollDuration;
    }

    function voteFor(string memory candidate) public beforeEnd afterStart {
        require(pollState != State.Cancelled);
        address voter = msg.sender;
        require(!isVoted[voter], "You have already voted!");

        isVoted[voter] = true;
        result[candidate] += 1;
    }

    function cancelPoll() public onlyOrg {
        pollState = State.Cancelled;
    }

    function getResult(
        string memory candidate
    ) public view dependsOnPollType returns(uint) {
        return result[candidate];
    }
}

